package test;

import java.net.InetSocketAddress;
import java.net.Proxy;
import java.net.URL;
import java.net.URLConnection;
import java.nio.charset.StandardCharsets;

public class ProxyExample {
    public static void main(String[] args) throws Exception {

//        byte[] decode = Base64.getDecoder().decode("");
//
//        System.out.println(new String(decode));
        // HTTP 的 SSR 订阅地址
        String subscriptionUrl = "ssr:";

        // 读取订阅地址内容
        URL url = new URL(subscriptionUrl);
        URLConnection connection = url.openConnection();
        connection.connect();
        String subscription = new String(connection.getInputStream().readAllBytes(), StandardCharsets.UTF_8);

        // 解析订阅地址获取代理服务器地址和端口
        String[] parts = subscription.split(":");
        String address = parts[0];
        int port = Integer.parseInt(parts[1]);

        // 创建代理服务器
        Proxy proxy = new Proxy(Proxy.Type.HTTP, new InetSocketAddress(address, port));

        // 创建 URL 连接并使用代理
        URL targetUrl = new URL("https://www.example.com/");
        URLConnection targetConnection = targetUrl.openConnection(proxy);

        // 发送 HTTP 请求并读取响应
        targetConnection.connect();
        System.out.println(targetConnection.getContent());
    }
}
